import pandas_datareader.data as pdrimport numpy as npimport datetimeticker = 'TSLA'ohlcv = pdr.get_data_yahoo(ticker, datetime.date.today() - datetime.timedelta(1825), datetime.date.today())n = 14# Plot# ohlcv['Adj Close'].plot()DF = ohlcv.copy()def CAGR(DF):    df = DF.copy()    df['daily_ret'] = DF['Adj Close'].pct_change()    df['cum_return'] = (1 + df['daily_ret']).cumprod()     n = len(df) / 252    CAGR = (df['cum_return'][-1]) ** (1 / n)    return CAGRcagr = CAGR(DF)